import React from "react";
import {
    StyleSheet, 
    View,
} from  "react-native";
import {Text} from "react-native-paper";

export default function UnlockPremium(props) {
    return (<View style={styles.container}>
        <Card>Unlock</Card>
    </View>);
}

const styles = StyleSheet.create({
    container: { 
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        backgroundColor: "#121212",
        paddingTop: 16,
        paddingBottom: 16,
        flex: 1,
    },
});
